// Matt Hood Signature - JPEG version for PDFKit compatibility
// This signature will be used when approval_approver_name = 'Matt Hood'

const MATT_HOOD_SIGNATURE = 'data:image/jpeg;base64,';

/**
 * Get Matt Hood's signature as a Buffer
 * @returns {Buffer} The signature image as a Buffer
 */
function getMattHoodSignature() {
  const base64Data = MATT_HOOD_SIGNATURE.replace(/^data:image\/[a-zA-Z0-9+.-]+;base64,/, '');
  return Buffer.from(base64Data, 'base64');
}

/**
 * Check if the approver is Matt Hood
 * @param {string} approverName - The approver's name
 * @returns {boolean} True if the approver is Matt Hood
 */
function isMattHood(approverName) {
  return approverName && approverName.toLowerCase().trim() === 'matt hood';
}

module.exports = {
  MATT_HOOD_SIGNATURE,
  getMattHoodSignature,
  isMattHood
};
